import { Divider, Grid } from "@mui/material";
import { Box, Container } from "@mui/system";
import "./App.css";
import Header from "./components/Header";
import VideoStreamer from "./components/VideoStreamer";

function App() {
    return (
        <Box>
            <Header />
            <hr />
            <Grid container>
                <Grid item xs={12} md={6} border={"2px solid green"} px={1}>
                    <VideoStreamer />
                </Grid>
                <Grid item xs={12} md={6} border={"2px solid orange"}>
                    <Box>Hello</Box>
                </Grid>
                <Grid item xs={12} border={"2px solid orange"}>
                    <Box height={{ xs: "30vh" }}>Hello</Box>
                </Grid>
            </Grid>
        </Box>
    );
}

export default App;
